import Rede from '../Redes';
import './Rodape.css';

const Rodape = () => {

    const imagens = [
        {
            src: "/imagens/tw.png",
            alt: "logo Twitter"
        },
        {
            src: "/imagens/fb.png",
            alt: "logo Facebook"
        },
        {
            src: "/imagens/ig.png",
            alt: "logo Instagran"
        }
    ]

    return (
        <footer className="rodape">
            <div>
                {
                    imagens.map(imagem => <Rede imagem={imagem.src} descricao={imagem.alt} />)
                }
            </div>
            <img src="/imagens/logo.png" alt="logo organo" />
            <h3>Desenvolvido por Alura.</h3>
        </footer>
    );
}

export default Rodape;
